import React, { Component } from 'react';
import './CheckoutPanel.style.scss';
import { Menu, Row, Col } from 'antd';
import {
  PieChartOutlined,
  DesktopOutlined,
  ContainerOutlined,
} from '@ant-design/icons';

export default class CheckoutPanel extends Component {

  constructor(props) {
    super(props);
    this.state = {
      collapsed: false
    }
  }

  toggleCollapsed = () => {
    this.setState({
      collapsed: !this.state.collapsed,
    });
  };

  render() {
    return (
      <div className="checkout-panel">
        <div className="checkout-panel__main-board">
          <Row>
            <Col span={2}>
              <div className="checkout-panel__main-board__navbar">
                <Menu
                  defaultSelectedKeys={['1']}
                  defaultOpenKeys={['sub1']}
                  mode="inline"
                  theme="dark"
                  inlineCollapsed={true}
                >
                  <Menu.Item key="1">
                    <PieChartOutlined />
                    <span>Option 1</span>
                  </Menu.Item>
                  <Menu.Item key="2">
                    <DesktopOutlined />
                    <span>Option 2</span>
                  </Menu.Item>
                  <Menu.Item key="3">
                    <ContainerOutlined />
                    <span>Option 3</span>
                  </Menu.Item>
                </Menu>
              </div>
            </Col>
            <Col span={22}></Col>
          </Row>
        </div>
      </div>
    )
  }
}
